import SearchInput from './Components/SearchInput'
import ElementUI from 'element-plus'
import './assets/icofont/icofont.css'

let MyUI = {};

MyUI.use(ElementUI)

MyUI.install = function(Vue) {
    Vue.component(SearchInput.name, SearchInput)
}

export default MyUI;
